export const RESTAURANT_ACTIONS = {
  loadRestaurants: "restaurants/loadRestaurants",
  startLoading: "restaurants/startLoading",
  successLoading: "restaurants/successLoading",
  failLoading: "restaurants/failLoading",
};

export const loadRestaurants = () => ({
  type: RESTAURANT_ACTIONS.loadRestaurants,
});

export const successLoading = (normalizedRestaurant) => ({
  type: RESTAURANT_ACTIONS.successLoading,
  payload: normalizedRestaurant,
});

export const failLoading = () => ({
  type: RESTAURANT_ACTIONS.failLoading,
});

export const startLoading = () => ({
  type: RESTAURANT_ACTIONS.startLoading,
});
